; Author: fastman92
; fastman92 limit adjuster: vehicle audio loader addon is used to apply properties
; Created 14/08/2015 (d-m-Y)
;
; File structure:
; A - Model Name
; B - Vehicle Type: 0 - car, 1 - motorbike, 2 - bike, 3 - boat, 4 - heli, 5 - plane, 8 - train, 9 - trailer, 10 - soundless vehicle
; C - Engine On sound bank ID
; D - Engine Off sound bank ID
; E - Radio Sound Type: 0 - normal, 1 - boosted bass (luxury cars), 2 - low quality sound (bikes and such)
; F - Bass Depth Boost - higher value means more bass
; G - Unknown float, possibly unused
; H - Horn Sound ID
; I - Horn Sound Pitch
; J - Door Sound ID
; K - Unknown integer, possibly unused - 1 for lowriders, 2 for street racers
; L - Default Radio ID: 1 - playback, 2 - k-rose, 3 - k-dst, 4 - bounce, 5 - sf-ur, 6 - rls, 7 - radio x, 8 - csr, 9 - k-jah, 10 - master sounds, 11 - wctr, 12 - user tracks, 13 - none
; M - Radio Type: 0 - normal, -1 and 1 - disabled, 3 - emergency vehicles scanner
; N - Police Scanner Description ID:
;	-1	- disabled
;	0	- off-road		4	- wagon		8	- garbage truck	12	- ambulance		16	- ice cream van	20	- coach			24	- truck		28	- plane		32	- bulldozer	36	- go-kart		40	- hovercraft	44	- camper van
;	1	- two-door		5	-			9	- limo			13	- helicopter	17	- buggy			21	- tank			25	- moped		29	- motorbike	33	- forklift	37	- lawnmower		41	- bike			45	- four-door
